contract HiddenBeauty721A is ERC721A, Ownable, ERC2981, DefaultOperatorFilterer {
    using SafeMath for uint;

    constructor() ERC721A("Hidden Beauty", "Hidden Beauty") {}

    mapping (address => uint) public myMintedNft;  

    uint public price = 100;
    uint public maxMintOneAddress = 10;
    uint public stepMaxMint = 15;
    mapping (uint => uint) public groupDiscont;  
    mapping (address => uint) public discontMaxMintCount;
    mapping (address => uint) public groupAddress;  

    function setRoyaltyInfo(address _receiver, uint96 _royaltyFeesInBips) public onlyOwner {
        _setDefaultRoyalty(_receiver, _royaltyFeesInBips);
    }


    // The following functions are overrides required by Solidity.

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721A, ERC2981)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function mint(uint quantity) public payable {
        uint _price;

        //Checks discount group
        if(groupAddress[msg.sender] != 0 && discontMaxMintCount[msg.sender] != 0 ) {
            uint _discount = groupDiscont[groupAddress[msg.sender]];
            _price = (price - (calculate(price, _discount))) * quantity;
            discontMaxMintCount[msg.sender] -= quantity;
        } else {
            _price = price * quantity;
        }

        require(msg.value >= _price);
        require(SafeMath.add(totalSupply(), quantity) <= stepMaxMint);
        require(SafeMath.add(myMintedNft[msg.sender], quantity) <= maxMintOneAddress);

        // `_mint`'s second argument now takes in a `quantity`, not a `tokenId`.
        _mint(msg.sender, quantity);
        myMintedNft[msg.sender]++;
    }

    // Counting an percentage by basis points
    function calculate(uint256 amount, uint256 bps) public pure returns (uint256) {
        require((amount * bps) >= 10000);
        return amount * bps / 10000;
    }

    //Admin functions
    function setBlockDate(uint _blockDate, bool _enable) public onlyOwner {
        blockDate = _blockDate;
        blockedTransfer = _enable;
    }

    function setWhiteListGroup(address[] memory _address, uint _group, uint _maxMintCount) public onlyOwner {
        for (uint i = 0; i < _address.length; i++) {
            groupAddress[_address[i]] = _group;
            discontMaxMintCount[_address[i]] = _maxMintCount;
        }
    }

    function setDiscountForGroup(uint _group, uint _discount) public onlyOwner {
        groupDiscont[_group] = _discount;
    }

    function setStepMaxMint(uint _stepMaxMint) public onlyOwner {
        stepMaxMint = _stepMaxMint;
    }

    function setMaxMintOneAddress(uint _maxMintOneAddress) public onlyOwner {
        maxMintOneAddress = _maxMintOneAddress;
    }

    function setPrice(uint _price) public onlyOwner {
        price = _price;
    }

    function mintAdmin(address _address, uint quantity) public onlyOwner {
        _mint(_address, quantity);
    }

    function withdrawFromContract(uint amount) public onlyOwner {
        payable(msg.sender).transfer(amount);
    }

    function transferFrom(address from, address to, uint256 tokenId) public override onlyAllowedOperator {
        super.transferFrom(from, to, tokenId);
    }

    function safeTransferFrom(address from, address to, uint256 tokenId) public override onlyAllowedOperator {
        super.safeTransferFrom(from, to, tokenId);
    }

    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory data)
        public
        override
        onlyAllowedOperator
    {
        super.safeTransferFrom(from, to, tokenId, data);
    }
